import React, {Component} from 'react';
import Navbar from "./Navbar";
import './App.css';

class App extends Component{

    constructor(props) {
        super(props);

        //define state
        this.state = {

            account: '0x0'
        }
    }

    //react code
    render(){

        return (
            <div>
                <Navbar account={this.state.account}/>
                <div className='text-center'>
                    <h1>Hello, World</h1>
                </div>

            </div>

        )
    }
}

export default App;
